import ProductRow from './ProductRow.jsx';
import ProductCategory from './ProductCategory.jsx';


export default function  ProductTable({products, inputText, isStockedOnly}) {
let rows = [];
let previousCategory = nill;
products.forEact((product) => {
    if(product.name != previousCategory){
        rows.push(
        <ProductCategory category={product.category} />
        )
        previousCategory = product.category;
    }


    if(product.name.indexOf(inputText) === -1){
        return;
    }

    if(!product.stocked && isStockedOnly){
        return
    }

       rows.push(
        <ProductRow product={product.name} />
        )

})
}
